import React from "react";
import '../../Styles/Search/Search.css'



class Search extends React.Component {

    state = {
        query: '',
      }

      handleInputChange = () => {
        this.setState({
          query: this.search.value
        })
      }

    render() {
        return(
            <div>
                <form id="demo-2">
                <input type="search" placeholder="Search"/>
                </form>
            </div>
        )
    }
}
export default Search
